import React from "react";
import { Image } from "./Image";


export const Producto = ({titulo, src}) => {
    const picture = (import(`${this.props.src}`));
    return(
        <div class="catalog">
            <div class="product-card">
                <div class="product-title">
                    <h1>{titulo}</h1>
                </div>
                <div class="product-image">
                    <img src={src}/>
                </div>
            </div>
        </div>
    );
};
